webpackJsonp([0x616d4ee7b21f],{418:function(a,t){a.exports={data:{markdownRemark:{html:'<p>Speaker: Handry Wahyudi</p>\n<p>Link: <a href="https://www.facebook.com/events/132003927525586">https://www.facebook.com/events/132003927525586</a></p>\n<p>Halo teman-teman! Kalau kamu adalah developer, mahasiswa, penggiat atau tech enthusiast, ayo gabung bersama kami di meetup #hacktoberfest untuk tahun 2017!</p>\n<p>Apa itu #hacktoberfest? Hacktoberfest merupakan event tahunan, yang berlansung pada bulan oktober selama 1 bulan. Event ini dibuat oleh github untuk menaikan jumlah kontribusi terhadap open source software.</p>\n<p>Dengan mengikuti #hacktoberfest kalian bisa mendapatkan t-shirt limited edition lho! Di acara ini akan diperkenalkan tentang cara kontribusi ke software open source.</p>\n<p>Ketika datang diharapkan:</p>\n<ul>\n<li>Membawa laptop</li>\n<li>Sudah mendaftar di sini <a href="https://github.com/join?source=header-home">https://github.com/join?source=header-home</a></li>\n<li>Sudah menginstall git.\nCara install: <a href="https://git-scm.com/book/id/v1/Memulai-Git-Menginstall-Git">https://git-scm.com/book/id/v1/Memulai-Git-Menginstall-Git</a></li>\n</ul>\n<p>Tertarik atau penasaran? Yuk, gabung di acara ini! Happy Coding!</p>',frontmatter:{title:"Hacktoberfest 2017",author:"Iank",date:"October 08, 2017"}}},pathContext:{slug:"events/2017-10-08/hacktoberfest-2017/"}}}});
